import React from "react";
import "../../Styles/Shared/HomeCard.scss";
import firstCardDollar from "../../Assets/svg/firstCardDollar.svg";

function HomeCard() {
  return (
    <div className='homeCard'>
      <h4>Battle Arena: Legends</h4>
      <p>
        The most insane, immersive battle yet. Every battle is different and
        unique.{" "}
      </p>
      <div className='homeCard__price'>
        <div className='lastPrice'>
          <img src={firstCardDollar} alt='' />
        </div>
      </div>
    </div>
  );
}

export default HomeCard;
